float2 cellScale = (cellAspectRatio > 1.0) ? float2(cellAspectRatio + maxRadius * 2.0, 1 + maxRadius * 2.0) : float2(1 + maxRadius * 2.0, 1/cellAspectRatio + maxRadius * 2.0);
_geometry.position.xy = _geometry.position.xy * cellScale;

float roundedRect( float2 p, float2 b, float r )
{
    return length(max(abs(p)-b+r,0.0))-r;
}

float sdCircle(float2 p, float2 c, float r)
{
    return length(p - c) - r;
}

#pragma arguments
float cellAspectRatio;
float photo1AspectRatio;
float photo2AspectRatio;
float dropTransition;
float dropTransitionBlurSpan;
float dropTransitionOpacitySpan;
float dropTransitionExposureFactor;
float permuteTransitionExposureFactor;
float permuteTransitionUVScale;
float permuteBokehBlurExpansionFactor;
float transition;
float maxRadius;
float cornerRadius;
texture2d photo1;
texture2d photo2;

#pragma body
float2 uv_0 = _surface.diffuseTexcoord;
float2 uv_1 = 2. * (uv_0 - 0.5);
float2 cellScale = (cellAspectRatio > 1.0) ? float2(cellAspectRatio + maxRadius * 2.0, 1 + maxRadius * 2.0) : float2(1 + maxRadius * 2.0, 1/cellAspectRatio + maxRadius * 2.0);
float2 p = uv_1 * cellScale;
float permuteBlurTransition = abs(2. * transition - 1.);
float dropBlurTransition = saturate((dropTransition - (1.0 - dropTransitionBlurSpan)) / dropTransitionBlurSpan);
float blurTransition = min(permuteBlurTransition, dropBlurTransition);
blurTransition = pow(blurTransition, 1.2);
float exposureTransition = mix(1.0, 0.0, blurTransition);
float opacityTransition = saturate((dropTransition - (1.0 - dropTransitionOpacitySpan)) / dropTransitionOpacitySpan);

uint w = photo1.get_width();
float nbMips = min(float(min(photo1.get_num_mip_levels(), photo1.get_num_mip_levels())), log2(maxRadius * 2. * w));
float lodt = smoothstep(0., 1., 1 - blurTransition);
float lod = 0.5 * nbMips * lodt;

float mixtSpan = 0.3;
float mixt = smoothstep(0.5 - mixtSpan, 0.5 + mixtSpan, transition);

float textureAspectRatio = transition < 0.5 ? photo1AspectRatio : photo2AspectRatio;
float ratio = textureAspectRatio / cellAspectRatio;

float uvScaleTransition = (1 - saturate(2.5 * blurTransition));
float uvScale = mix(1.0, 0.97, uvScaleTransition) * permuteTransitionUVScale;

float fitScale = cellAspectRatio > 1.0 ? (ratio > 1.0 ? 1.0 : 1 / cellAspectRatio) : (ratio > 1.0 ? cellAspectRatio : 1.0);
float2 aspectScale = (ratio > 1.0 ? float2(1 / textureAspectRatio, 1.0) : float2(1.0, textureAspectRatio));
float2 uv = 0.5 + p * fitScale * aspectScale * 0.5 * uvScale;

float2 sdfAspectCorrected = cellAspectRatio > 1.0 ? float2(cellAspectRatio, 1.0) : float2(1.0, (1.0 / cellAspectRatio));
float currentRadius = (exp2(lod + 1) / w) * 2;

float sdf = roundedRect(p, sdfAspectCorrected, cornerRadius);
float mask = roundedRect(p, sdfAspectCorrected, cornerRadius);
float baseMask = 1. - smoothstep(-0.01, 0., mask);

currentRadius *= permuteBokehBlurExpansionFactor;
mask = 1. - smoothstep(-currentRadius, currentRadius, mask);

sampler smp(filter::linear, mip_filter::linear, address::clamp_to_zero);

if(transition <= 0. && dropTransition == 1.0){
    _surface.diffuse =  photo1.sample(smp, uv) * baseMask;
} else if (transition >=1. && dropTransition == 1.0){
    _surface.diffuse =  photo2.sample(smp, uv) * baseMask;
} else {
    _surface.diffuse =  4. * mix(photo1.sample(smp, uv, level(lod), int2( 0,  0)), photo2.sample(smp, uv, level(lod), int2( 0,  0)), mixt);
    _surface.diffuse += 2. * mix(photo1.sample(smp, uv, level(lod), int2( 1,  0)), photo2.sample(smp, uv, level(lod), int2( 1,  0)), mixt);
    _surface.diffuse += 2. * mix(photo1.sample(smp, uv, level(lod), int2(-1,  0)), photo2.sample(smp, uv, level(lod), int2(-1,  0)), mixt);
    _surface.diffuse += 2. * mix(photo1.sample(smp, uv, level(lod), int2( 0,  1)), photo2.sample(smp, uv, level(lod), int2( 0,  1)), mixt);
    _surface.diffuse += 2. * mix(photo1.sample(smp, uv, level(lod), int2( 0, -1)), photo2.sample(smp, uv, level(lod), int2( 0, -1)), mixt);
    _surface.diffuse += 1. * mix(photo1.sample(smp, uv, level(lod), int2( 1,  1)), photo2.sample(smp, uv, level(lod), int2( 1,  1)), mixt);
    _surface.diffuse += 1. * mix(photo1.sample(smp, uv, level(lod), int2(-1,  1)), photo2.sample(smp, uv, level(lod), int2(-1,  1)), mixt);
    _surface.diffuse += 1. * mix(photo1.sample(smp, uv, level(lod), int2( 1,  1)), photo2.sample(smp, uv, level(lod), int2( 1,  1)), mixt);
    _surface.diffuse += 1. * mix(photo1.sample(smp, uv, level(lod), int2( 1, -1)), photo2.sample(smp, uv, level(lod), int2( 1, -1)), mixt);

    _surface.diffuse /= 16.;
    _surface.diffuse.rgb *= 1. + (lodt * 1.5) * (1 + exposureTransition * dropTransitionExposureFactor);
    _surface.diffuse.a = saturate(_surface.diffuse.a);
    _surface.diffuse *= mask;
    _surface.diffuse *= opacityTransition;

    float blurWhitenessTransition = uvScaleTransition * permuteTransitionExposureFactor;
    _surface.diffuse.rgb = mix(_surface.diffuse.rgb, float3(1.0, 1.0, 1.0), blurWhitenessTransition);
}

