float tint;

#pragma body

float2 animatingGradientStartCoordinates = float2(-0.3, -0.3);
float animatingGradientIterations = 2.0;
float animatingGradientScale = 5.0;
float animatingGradientSpeed = 0.2;
float2 animatingGradientEndCoordinates = float2(0.3, 0.3);

float2 uv_0 = _surface.diffuseTexcoord;
float2 uv_1 = 2. * (uv_0 - 0.5);
float2 cellScale = (cellAspectRatio > 1.0) ? float2(cellAspectRatio + maxRadius * 2.0, 1 + maxRadius * 2.0) : float2(1 + maxRadius * 2.0, 1/cellAspectRatio + maxRadius * 2.0);
float2 p = uv_1 * cellScale;
float opacityTransition = saturate(dropTransition);

float2 sdfAspectCorrected = cellAspectRatio > 1.0 ? float2(cellAspectRatio, 1.0) : float2(1.0, (1.0 / cellAspectRatio));
float sdf = roundedRect(p, sdfAspectCorrected, cornerRadius);
float mask = roundedRect(p, sdfAspectCorrected, cornerRadius);
float baseMask = 1. - smoothstep(-0.01, 0., mask);

mask = 1. - smoothstep(-0.01, 0, mask);

float vfxAssembleFadeInSpan = 0.65;
float vfxAssembleFadeOutSpan = 0.35;
float vfxAssembleFadeOutOpacity = saturate(1.0 - (dropTransition - vfxAssembleFadeInSpan) / vfxAssembleFadeOutSpan);
float vfxAssembleFadeInOpacity = saturate(dropTransition / vfxAssembleFadeInSpan);
opacityTransition = vfxAssembleFadeInOpacity * vfxAssembleFadeOutOpacity;

float2 uvScreen = in.fragmentPosition.xy * vfx_frame.inverseResolution;

float circleDistance = 2.0;
float2 point = (uvScreen - 0.5) * 2.0 / animatingGradientScale;
float d0 = sdCircle(point, animatingGradientStartCoordinates, 0.0);
float d1 = sdCircle(point, animatingGradientEndCoordinates, 0.0);

float d = (-d0 + d1);
float span = 1.0;
float normD = clamp((d + span) / (span * 2.0), 0.0, 1.0);
float modD = fmod(normD * animatingGradientIterations + vfx_frame.time * animatingGradientSpeed, 1.0);

float3 blue = float3(0.0/255.0, 150.0/255.0, 255.0/255.0);
float3 purple = float3(188.0/255.0, 101.0/255.0, 255.0/255.0);
float3 red = float3(255.0/255.0, 44.0/255.0, 85.0/255.0);
float3 orange = float3(255.0/255.0, 148.0/255.0, 0.0/255.0);

blue = pow(blue, 2.2);
purple = pow(purple, 2.2);
red = pow(red, 2.2);
orange = pow(orange, 2.2);

float3 gradColor = blue;
gradColor = modD > 0.375 ? purple : gradColor;
gradColor = modD > 0.60 ? red : gradColor;
gradColor = modD > 0.80 ? orange : gradColor;

float3 tintColor = float3(52.0/255.0, 120.0/255.0, 246.0/255.0);
tintColor = pow(tintColor, 2.2);
gradColor = mix(gradColor, tintColor, tint);

_surface.diffuse.rgb = gradColor;
_surface.diffuse *= mask;
_surface.diffuse *= opacityTransition;

