float sdCircle(float2 p, float2 c, float r)
{
    return length(p - c) - r;
}

float wave(float t, float start, float mid, float end) {
    float rampUp = smoothstep(start, mid, t);
    float rampDown = 1 - smoothstep(mid, end, t);
    return rampUp * rampDown;
}

float3 mapRamp(float t) {
    float3 blue = float3(0.0/255.0, 150.0/255.0, 255.0/255.0);
    float3 purple = float3(188.0/255.0, 101.0/255.0, 255.0/255.0);
    float3 red = float3(255.0/255.0, 44.0/255.0, 85.0/255.0);
    float3 orange = float3(255.0/255.0, 148.0/255.0, 0.0/255.0);

    blue = pow(blue, 2.2);
    purple = pow(purple, 2.2);
    red = pow(red, 2.2);
    orange = pow(orange, 2.2);

    float3 color = blue;
    color = t > 0.375 ? purple : color;
    color = t > 0.60 ? red : color;
    color = t > 0.80 ? orange : color;

    return color;
}

float3 tint(float tintFactor, float3 color) {
    float3 tintColor = float3(52.0/255.0, 120.0/255.0, 246.0/255.0);
    tintColor = pow(tintColor, 2.2);
    return mix(color, tintColor, tintFactor);
}

float wavefront(float2 uv, float2 center, float t, float waveBias, float waveDeceleration, float waveSpan, float waveIterations, float waveDecay) {
    float d = sdCircle(uv, center, 0.0);
    float normD = saturate(d);
    float decayedD = 1.0 - pow(1.0 - normD, 1 / max(waveDeceleration, 1.0));
    float modD = fmod((1.0 - decayedD) * waveIterations + t, 1.0);
    float waveFrontD = saturate(modD * waveSpan);
    float decaySpan = 0.85;
    float decayD = saturate(d / decaySpan);
    float amplitudeDecay = (1 - pow(decayD, waveDecay));
    float waveAlpha = wave(waveFrontD, 0.0, waveBias, 1.0) * amplitudeDecay;
    return waveAlpha;
}

float radialGradient(float2 uv, float2 start, float2 end, float scale) {
    float2 point = (uv - 0.5) * 2.0 / scale;
    float dStart = sdCircle(point, start, 0.0);
    float dEnd = sdCircle(point, end, 0.0);
    float d = (-dStart + dEnd);
    float span = 1.0;
    d = saturate(d + span / (span * 2.0));
    return d;
}

