float smoothedAlpha = 1.0 - smoothstep(-edgeSoftness, edgeSoftness, abs(sdf) - thickness);
float4 bezelMaskAlpha = mix(float4(0.0), float4(1.0, 1.0, 1.0, smoothedAlpha), smoothedAlpha);
float4 bezelMaskOpaque = mix(float4(0.0, 0.0, 0.0, 1.0), float4(1.0, 1.0, 1.0, 1.0), smoothedAlpha);

float3 worldPos = mix(vfx_node.worldBoundingBox[0].xyz, vfx_node.worldBoundingBox[1].xyz, 0.5);
