float3 viewPos = mix(pWFrag, pWCell, quantizeMix);

float2 uvScreen = (vfx_frame.inverseViewTransform * float4(viewPos, 1.0)).xy;
float scaleFactor = 1 / (radius);
uvScreen *= scaleFactor;
