waveAlpha += wavefront(uvScreen, center4Screen, time4, waveBias, waveDeceleration, waveSpan, waveIterations, waveDecay);
waveAlpha += wavefront(uvScreen, center5Screen, time5, waveBias, waveDeceleration, waveSpan, waveIterations, waveDecay);
waveAlpha += wavefront(uvScreen, center6Screen, time6, waveBias, waveDeceleration, waveSpan, waveIterations, waveDecay);

float2 uvScreenChroma = in.fragmentPosition.xy * vfx_frame.inverseResolution;
